TextFile CloseF(TextFile F)
{
  int i = 0;
  if (F != TextFileNull() && F != stdin && F != stdout && F != stderr) {
#ifdef XREADANDWRITEF
    isAssign = 1;
    while(i<NFiles && FilePtr[i]!= F)i++;
    if (i<FOPEN_MAX) {
      free (NameOfFile[i]);
      FilePtr[i] = NULL;
      NameOfFile[i] = NULL;
      NFiles --;
    }
#endif
    fclose(F);
  }
  return TextFileNull();
}

