SDL_Time GetTime(TextFile F, SDL_Charstring Prompt)
{
  SDL_Time Result;
  double t;

#if !defined(XTIMEASINT_TICKS) && !defined(XTIMEASINT_SECS)
  Result.s = 0; Result.ns = 0;
#else
  Result = 0;
#endif

#ifdef XMONITOR
  if (F == stdin) {
     xGetValue(F, Prompt, xSrtN_SDL_Time, (void *)&Result, "GetTime");
     return Result;
  }
#endif
  fscanf (F, "%lf", &t);
  Result.s = (int) t;
  Result.ns = (int) ((t - (double) (Result.s)) * 1000000000.0);
  return Result;
}

